import PropTypes from 'prop-types';

export const TableBodyItem = ({ items }) => {
  return items.map(({ id, type, amount, currency }) => {
    return (
      <TableBodyTr key={id}>
        <td>{type}</td>
        <td>{amount}</td>
        <td>{currency}</td>
      </TableBodyTr>
    );
  });
};

TableBodyItem.prototype = {
  id: PropTypes.string,
  type: PropTypes.string,
  amount: PropTypes.string,
  currency: PropTypes.string,
};
